import TimeDisplay from './components/TimeDisplay';
import TimeInput from './components/TimeInput';
import Location from './components/Location';

function App() {
	return (
		<div className='App'>
			<Header />
			<Location />
			<TimeDisplay />
			<TimeInput />
		</div>
	);
}

export default App;
